import React from 'react';
import "../css/itemcontents.css";

class ItemContents extends React.Component {
  componentDidMount(){
    const {name, image, price, details} = this.props;
  }
  render(){
    return (
      <>
        <span>
          {this.props.name}
        </span>
        </>
      )
    }
}

 
export default ItemContents;
